search.support.getParameterByName=function(url,name){name=name.replace(/[\[]/,"\\\[").replace(/[\]]/,"\\\]");var regexS="[\\?&]"+name+"=([^&#]*)";var regex=new RegExp(regexS);var results=regex.exec(url);if(results==null){return"";}else{return decodeURIComponent(results[1].replace(/\+/g," "));}}
search.support.setParameterByName=function(url,name,value){name=name.replace(/[\[]/,"\\\[").replace(/[\]]/,"\\\]");var regexS="[\\?&]"+name+"=([^&#]*)";var regex=new RegExp(regexS);var results=regex.exec(url);if(results==null){return url;}else{return url.replace(name+"="+results[1],name+"="+encodeURIComponent(value));}}
